ISLAMABAD, Feb 9 (APP): Independent candidate, Jahanzeb Khan Khichi has won the election for Punjab Assembly constituency PP-235, Vehari-VII by securing 50,250 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was Pakistan Muslim League (N) candidate, Mian Khaliq Nawaz who bagged 39,525 votes. The votersâ€™ turn-out remained 52.34%.
